@notice Grants privilege to the specified account.
@param account The address to grant the privileged role.
@dev Can only be called by the owner.

@notice Revokes the PRIVILEGED_ROLE from the specified account.
@param account The address of the account to have its PRIVILEGED_ROLE revoked.
@dev This function can only be called by the owner.

@dev Creates a new Pool contract for the provided token pair and stores the pool address.
@param thisToken The address of the first token in the pool.
@param thatToken The address of the second token in the pool.
@return The address of the newly created Pool contract.

@dev Sets the development fund address to the provided address.
Can only be called by the owner of the contract.
@param _developmentFundAddress The new address to be set as the development fund address.

@dev Sets the allocation for the upkeep of the protocol in the form of a percentage (using full precision, e.g., 10 ** 18 = 100%).
Can only be called by the owner of the contract.
Allocation cannot exceed 100% (expressed as 10 ** 18 for full precision).
@param _upkeepAllocation The new upkeep allocation (using full precision).

@dev Sets the share of the routing agent in the form of a percentage (using full precision, e.g., 10 ** 18 = 100%).
Can only be called by the owner of the contract.
Routing agent share cannot exceed 100% (expressed as 10 ** 18 for full precision).
@param _routingAgentShare The new routing agent share amount (using full precision).
